const Course = ({ course }) => {
	return (
		<div>
			<Header name={course.name} />
			<Content parts={course.parts} />
		</div>
	);
};

const Header = ({ name }) => {
	return <h2>{name}</h2>;
}

const Content = ({ parts }) => {
	return (
		<div>
			{parts.map((part) => (
				<Part key={part.id} name={part.name} excercises={part.excercises} />
			))}
		</div>
	)
}

const Part = ({ name, excercises }) => {
	return
}

export default Course;
